INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (213,'057','하여튼 아무튼 대체 어떤 한 사람으로부터 해를 당하게 되는 불리한 운입니다. 한마디로 운수가 불리하니 좋은 일만 있을만하면 곧 마가 생기기 마련입니다. 뜻은 있으나 이루기가 쉽지 않겠으니 추우니 이 신수를 어떻게 하겠습니까. 해가 이미 서산에 저물었는데 진퇴를 알지 못하니 답답할 상입니다 재물은 길이 있으니 나아가 구하면 얻을 수 있겠습니다. 머리는 작고 몸은 약하니 일을 능히 당해낸기가 어렵습니다. 산을 넘고 바다를 건넌다는 말이 도리어 한말씀을 알게 될 것입니다. 운수가 흉하고 명리가 흉하게 되었으니 재물이 흐려져도 흉기가 어렵습니다. 멀리 여행을 가게 되면 이롭지 못하니 답답하다해도 차차이 상책입니다.','구름 밖 만리에 훨훨 단신 외로운 몸이니 얼마나 고독하고 쓸쓸하겠습니까. 가신이 발동했으니 가족이 불안하겠습니다. 모든 것을 잘 감수해야 합니다 가정 운수가 좋지 않아 근심이 떠나지 않을 것이나 주의하면 큰 탈은 없겠습니다.','먼하가 화풍을 피어 그 향기가 새롭고 아름다우나 어떻게 기쁘지 않겠습니까. 이것은 서천에 있으니 일을 마무리 지을 때 잘 해야 합니다. 시비를 가까이 하게 되면 해롭고 구설이 따르게 되니 정절을 지켜야 합니다.','재산이 허공 중에 나타나니 재물을 구해도 얻기 가 어렵겠습니다. 집에 질고가 있으니 마음이 불안하고 편안치 못하겠으니 스스로 위로해야 합니다. 비록 길함이 있더라도 크게 얻는 것이 아니니 신중하게 임해야 합니다.','땅밖의 공명하여 사람들이 너무 흠모하게 되겠습니다. 모든 사람들이 우러러봅니다. 손재수가 따르니 사람 사귀기를 신중하고 성실으로 대해야 합니다. 님이 사방으로 있으니 어떻게 태평하지 않겠습니까. 실로 좋은 일이 있겠습니다.','이상하거나 무상하게 생각되는 곳은 가지 마십시오. 후앙이 두렵습니다. 안정을 생각하여 일을 진행하다가는 도리어 그 해를 받겠습니다. 마음에 내키지 않는 일은 하지 마십시오. 일이 뜻대로 되기가 어려우니 그저 자중하면서 차는 게 제일입니다.','물과 불을 조심하십시오. 후앙수가 친척할까 두렵습니다. 마조심을 해야만 일이 정직될 것입니다. 시비를 가까이 하게 되면 이익이 없을 것이니 남과 다투어서는 안됩니다. 만약 이럭 같지 않으면 구설수가 분분하여 흔자서 감당하기가 어렵겠습니다.','동쪽과 북쪽 양방향에 불행하게도 한편 이름이 나기 시작하니 기이 불안하겠습니다. 동서남북을 들여다봐도 마땅히 의지할 곳이 없으니 이 외로움을 어떻게 면하겠습니까. 친척이나 손척을 가지 마십시오. 잘못하면 발 배우자와 이별하게 될지도 모릅니다.','문밖 멀리 나가지 마십시오. 뜻하지 아니한 액이 닥치면 감당하기 쉽지 않겠습니다. 손재수가 있으니 모든 일을 조심하고 주의 깊게 살펴야만 면하게 됩니다. 사람을 잘 못 사귀면 불길하니 항상 신의로써 대하되 함부로 대해서는 안됩니다.','먼저되게 이동해서는 안됩니다. 후앙수가 친척할 것이니 분수를 지켜서 참회하게 행동해야 합니다. 신인이 불리하니 남의 일을 당하기 쉽습니다. 건강을 지키십시오. 한 번은 순통하고 한 번은 근심걱정이 생길 것이니 길흉이 상반되겠습니다.','마음에 노고가 많으나 마침내 길함이 있겠습니다. 그동안 참고 갈대린 대책입니다. 동쪽으로 오는 사람은 필시 원수가 되겠으니 새 일을 도모할 때는 냉냉한 말에 빠지지 마십시오. 음침한 곳을 가까이 하게 되면 손재를 면하기가 어렵겠습니다.','음양이 화합되지 않으니 부부간에 화합하기가 어렵겠습니다. 성실을 잘 지켜야 합니다. 작은 재물이 있으니 구하면 얻을 수 있습니다. 첩첩 모아 태산이니 신중하게 임하십시오. 글씨의 운수는 먼저는 흉하고 뒤에는 길하니 인내심을 가지고 임해야 합니다.','비록 재물이 있으나 얻은 것이 도리어 흉하게 되리니 얻은 것을 식히지 마십시오. 만약 사람을 잘못 사귀다면 필시 손해를 보게 될 것이니 주의해야 합